function Login() {
  return (
    <form>
      <label htmlFor="email">
        Nome de usuário ou e-mail:
        <input
          input="text"
          placeholder="Insira seu nome de usuário ou e-mail"
          id="email"
          name="email"
          value={ 'false' }
          onChange = { () => {} }
        />
      </label>
    </form>
  );
}

export default Login;
